import React, { useState, useEffect } from 'react';

const IndicatorsWeekly = () => {
    const [state, setState] = useState([]);
    const [filteredData, setFilteredData] = useState([]);
    const [filter, setFilter] = useState({
        id: '',
        symbol: '',
        signal: '',
    });
    const [error, setError] = useState(null);

    useEffect(() => {
        // Fetch data from the backend
        fetch('http://localhost:8080/api/indicators/weekly')
            .then(response => {
                if (!response.ok) {
                    throw new Error('Failed to fetch data');
                }
                return response.json();
            })
            .then(data => {
                console.log(data); // Log data to ensure it looks correct
                setState(data);
                setFilteredData(data); // Initialize filteredData with all data
            })
            .catch(err => {
                setError(err.message); // Set error if fetch fails
                console.error("Error fetching data: ", err);
            });
    }, []);

    // Handle filter input change
    const handleFilterChange = (e) => {
        const { name, value } = e.target;
        setFilter(prevFilter => ({
            ...prevFilter,
            [name]: value,
        }));
    };

    // Filter data based on the filter values
    useEffect(() => {
        const filtered = state.filter(item => {
            return (
                (filter.id ? item.id.toString().includes(filter.id) : true) &&
                (filter.symbol ? item.issuer.symbol.toLowerCase().includes(filter.symbol.toLowerCase()) : true) &&
                (filter.signal ? item.signal.toLowerCase().includes(filter.signal.toLowerCase()) : true)
            );
        });
        setFilteredData(filtered);
    }, [filter, state]);

    return (
        <div className="list-container">
            <h2>List of Weekly Indicators</h2>
            {error ? (
                <p>Error: {error}</p> // Display error if something goes wrong
            ) : (
                <div>
                    {/* Filter Inputs */}
                    <div className="filters">
                        <input
                            type="text"
                            name="id"
                            placeholder="Filter by ID"
                            value={filter.id}
                            onChange={handleFilterChange}
                        />
                        <input
                            type="text"
                            name="symbol"
                            placeholder="Filter by Symbol"
                            value={filter.symbol}
                            onChange={handleFilterChange}
                        />
                        <input
                            type="text"
                            name="signal"
                            placeholder="Filter by Signal"
                            value={filter.signal}
                            onChange={handleFilterChange}
                        />
                    </div>

                    {filteredData.length === 0 ? (
                        <p>Loading data...</p> // Display loading message if data is not yet fetched
                    ) : (
                        <table>
                            <thead>
                            <tr>
                                <th>Symbol</th>
                                <th>High Price</th>
                                <th>Low Price</th>
                                <th>SMA 50</th>
                                <th>SMA 200</th>
                                <th>EMA 50</th>
                                <th>EMA 200</th>
                                <th>RSI</th>
                                <th>Stochastic</th>
                                <th>MACD</th>
                                <th>CCI</th>
                                <th>Williams R</th>
                                <th>Signal</th>
                            </tr>
                            </thead>
                            <tbody>
                            {filteredData.map(obj => (
                                <tr key={obj.id}>
                                    <td>{obj.issuer.symbol}</td>
                                    <td>{obj.highPrice}</td>
                                    <td>{obj.lowPrice}</td>
                                    <td>{obj.sma50}</td>
                                    <td>{obj.sma200}</td>
                                    <td>{obj.ema50}</td>
                                    <td>{obj.ema200}</td>
                                    <td>{obj.rsi}</td>
                                    <td>{obj.stochastic}</td>
                                    <td>{obj.macd}</td>
                                    <td>{obj.cci}</td>
                                    <td>{obj.williamsR}</td>
                                    <td>{obj.signal}</td>
                                </tr>
                            ))}
                            </tbody>
                        </table>
                    )}
                </div>
            )}
        </div>
    );
};

export default IndicatorsWeekly;
